Open a new account: mutation { bankAccountMutation( id: "1234", command: { openAccount: { accountId: "1234" } } ){ accountId balance writtenChecks accountTransactions{ description amount } }
} Query an existing account: query { bankAccountQuery(id: "1234") { accountId balance writtenChecks accountTransactions{ description amount } }
} Query only the account balance: query { bankAccountQuery(id: "1234") { balance }
} Deposit money into an account:: mutation { bankAccountMutation( id: "1234", command: { depositMoney: { amount: 123 } } ){ accountId balance writtenChecks accountTransactions{ description amount } }
} Withdraw money from an account: mutation { bankAccountMutation( id: "1234", command: { withdrawMoney: { amount: 123, atmId: "ExampleAtmIdHere" } } ){ accountId balance writtenChecks accountTransactions{ description amount } }
}
